import React, { useState, useEffect } from "react";
import axios from "axios";

const Todos = () => {
  const [todos, setTodos] = useState("");

  const getTodos = () => {
    axios
      .get("/todos")
      .then((res) => setTodos(res.data))
      .catch((err) => console.error(err));
  };

  useEffect(() => {
    getTodos();
  }, []);

  return (
    <div>
      {/* {<ul>
        {todos.forEach((todo) => (
          <li key={todo.id}>{todo.title}</li>
        ))}
      </ul>} */}

    </div>
  );
};

export default Todos;
